import { motion } from "framer-motion"

const Intro = () => {

    return(
        <div className='Intro'>
            <h1> 
                <motion.span initial={{opacity: 0}} animate={{opacity: 1}} variants={spanVariants[0]}  >Responsive. </motion.span>
                <motion.span initial={{opacity: 0}} animate={{opacity: 1}} variants={spanVariants[1]}  >Clean. </motion.span>
                <motion.span initial={{opacity: 0}} animate={{opacity: 1}} variants={spanVariants[2]} className='to-color'>Stable.</motion.span> 

            </h1>
            <h2 className='josiah-eakle-header'> 
                <motion.span initial={{opacity: 0}} animate={{opacity: 1}} variants={spanVariants[3]} className='to-color'>Josiah Eakle </motion.span>
                <motion.span initial={{opacity: 0}} animate={{opacity: 1}} variants={spanVariants[3]} >Full-Stack Developer</motion.span>
            </h2>

        </div>
    ); 
}

export default Intro;
